100ef.png',NULL),(33,'user31.png','/upload/profile_img/d7dfc77f-a2c8-4412-9466-d1a97225660d.png','d7dfc77f-a2c8-4412-9466-d1a97225660d.png',NULL),(34,'user32.png','/upload/profile_img/d62e487d-e225-40a8-bad3-f2d55d784b61.png','d62e487d-e225-40a8-bad3-f2d55d784b61.png',NULL),(35,'user33.png','/upload/profile_img/9ba34521-2e5e-48b5-85c2-cb330c191f78.png','9ba34521-2e5e-48b5-85c2-cb330c191f78.png',NULL),(36,'user34.png','/upload/profile_img/88305578-a048-4b10-af9f-a93dca51373a.png','88305578-a048-4b10-af9f-a93dca51373a.png',NULL),(37,'user35.png','/upload/profile_img/e0a4d661-87dd-4305-9864-b90bfaf02e99.png','e0a4d661-87dd-4305-9864-b90bfaf02e99.png',NULL),(38,'user36.png','/upload/profile_img/ede51b48-b4ee-4086-ab15-f10d57224158.png','ede51b48-b4ee-4086-ab15-f10d57224158.png',NULL),(39,'user37.png','/upload/profile_img/9d689b42-a01e-4ad6-97b9-4a698ed0cdb9.png','9d689b42-a01e-4ad6-97b9-4a698ed0cdb9.png',NULL),(40,'user38.png','/upload/profile_img/af6e0c85-fc9e-490e-9996-db42af2b3ee7.png','af6e0c85-fc9e-490e-9996-db42af2b3ee7.png',NULL),(41,'user63.png','/upload/profile_img/00a2b734-deb3-469a-b72a-973c005e630a.png','00a2b734-deb3-469a-b72a-973c005e630a.png',NULL);
INSERT INTO `video` VALUES (2,'마이클 애덤스웨이트',' 마이클 헤그너, 저스틴 머피','닌자고 시티를 누비며 적과 맞서 싸우는 닌자들 이제 도시를 벗어나 색다른  세계로 출동한다 . 낯선 환경에서 믿을 건 동료뿐 . 그런데 악당에 맞서다 우정이  시험대에 오를 줄이야. 승리를 위해, 새로운 동료와 함께 서로의 힘을 믿어라! ','액션','KID','닌자고','DRAMA',0),(5,'베어그릴스 ','벤심스 ','중앙아메리카의 오지로 말라리아 백신을 운반하던 박사가 실종된다.  사나운 야생동물이 득실대는 울창한 정글. 베어는 그녀를 구할 수 있을까? 당신의 선택에 달려있다. ','일상','KID','당신과 자연의 대결 ','DRAMA',0),(8,'김동완, 전세현, 김병옥 등','김진영','대선후보의 B컷을 둘러싼 충격 스캔들이 펼쳐진다! 스마트폰수리 및 데이터 복구 업체를 운영하는 \'승현\'은 고객들의 B컷, 즉 숨기고 싶어 삭제했던 데이터까지 복구해서 협박하며 돈을 뜯어낸다. 어느날, 한때 최고의 여배우였던 \'민영\'은 \'승현\'에게 망가진 핸드폰 수리를 맡기고, 그 폰 안에서 찾아낸 \'민영\'의 B컷에는 그의 남편이자 유력한 대통령 후보자인 \'태산\'의 충격적인 진실이 들어있는데…!','스릴러','ALL','B컷','MOVIE',0),(11,'유오성, 장혁 외','윤영빈','강릉 최대 조직의 ‘길석’ 평화와 의리를 중요시하며 질서 있게 살아가던 그의 앞에 강릉 최대 리조트 소유권을 노리고 서울에서 온 남자 ‘민석’이 나타난다 첫 만남부터 서늘한 분위기가 감도는 둘, ‘민석’이 자신의 목표를 위해 본격적으로 움직이기 시작하면서 두 조직 사이에는 겉잡을 수 없는 전쟁이 시작되는데.. 거친 운명 앞에 놓인 두 남자 그들의 이야기가 시작된다','액션','ALL','강릉','MOVIE',0),(14,'정우성, 곽도원 등','양우석','북한 쿠데타 발생 북한 1호가 남한으로 내려왔다!  쿠데타 발생 직후 최정예요원 \'엄철우\'(정우성)는 치명상을 입은 북한 1호와 함께 남한으로 내려온다. 그 사이 북한은 대한민국과 미국을 상대로 선전포고를, 남한은 계엄령을 선포한다. 이때 북한 1호가 남한으로 내려왔다는 정보를 입수한 외교안보수석 \'곽철우\'(곽도원)는 전쟁을 막기 위해 이들에게 긴밀한 접근을 시도하는데...','액션','ALL','강철비','MOVIE',0),(17,'홍범기, 안효민 , 톰 웨이랜드','김철수 ','월드스타 라바가 넷플릭스와 만났다! 더 키진 웃음, 더 새로운 친구들, 라바사상 최초 \' 인간\'의 등장까지! 뉴욕을 떠나 무인도에 불시착한 레드와 옐로우의 좌충우돌 생존기!  과연 그들은 무사히 집에 돌아갈 수 있을까? ','일상','KID','라바 아일랜드','DRAMA',0),(20,'조진웅,최우식,박희순,권율,박명훈 외','이규만','경찰의 기준이 뒤집어진다!  출처불명의 막대한 후원금을 받고 고급 빌라, 명품 수트, 외제차를 타며 범죄자들을 수사해온 광역수사대 반장 강윤(조진웅)의 팀에 어느 날 뼛속까지 원칙주의자인 신입경찰 민재(최우식)가 투입된다.','스릴러','ALL','경관의 피','MOVIE',0),(23,'김상경, 이선빈, 윤경호, 서영희 외','조용선','“알고 있었죠, 사람이 죽을 수도 있다는 거”  봄이 되면 나타났다 여름이 되면 사라지는 죽음의 병. 공기를 타고 대한민국에 죽음을 몰고 온 살인무기의 실체를 밝히기 위한 그들의 사투. 증발된 범인, 피해자는 증발되지 않았다!','스릴러','ALL','공기살인','MOVIE',0),(26,'현빈,유해진,임윤아,다니엘헤니,진선규','이석훈','잔혹하고 치밀한 범죄 조직을 쫓아 남에 파견된 북한 형사 \'림철령\'과 광수대 복귀를 위해 파트너를 자청한 남한 형사 \'강진태\', 여기에 미국 FBI 소속 \'잭\'까지, 각자의 목적으로 뭉친 남북미 형사들의 예측불허 글로벌 공조 수사를 그린 영화','액션','ALL','공조2 인터내셔날','MOVIE',0),(29,'김서영, 이윤희 .김은하 ','김이비','우리는 세상에서 엄마가 제일 좋아요! 매일매일 무럭무럭 자라나는 꿩병아리 4남매와  엄마 카투리와 이야기. 숲속 친구들과 재미있는 놀이도 하고, 자연을 탐험해볼까요? ','일상','KID','엄마 까투리 극장판','MOVIE',0),(32,'황정민,현빈,강기영 외','임순례','중동에서 납치된 한국인을 구하고자 고군분투하는 외교관과 국정원 요원의 이야기 “어떤 경우라도 희생자를 안 만드는 게 이 협상의 기조 아닙니까?”  분쟁지역 아프가니스탄에서 한국인들이 탈레반에게 납치되는 최악의 피랍사건이 발생한다. 교섭 전문이지만 아프가니스탄은 처음인 외교관 재호(황정민)가 현지로 향하고, 국정원 요원 대식(현빈)을 만난다.','스릴러','ALL','교섭','MOVIE',0),(35,'류승룡, 이하늬, 진선규, 이동휘, 공명','이병헌','에는 치킨장사! 밤에는 잠복근무! 지금까지 이런 수사는 없었다!  불철주야 달리고 구르지만 실적은 바닥, 급기야 해체 위기를 맞는 마약반! 더 이상 물러설 곳이 없는 팀의 맏형 고 반장(류승룡)은 국제 범죄조직의 국내 마약 밀반입 정황을 포착하고 장 형사(이하늬), 마 형사(진선규), 영호(이동휘), 재훈(공명)까지 4명의 팀원들과 >함께 잠복 수사에 나선다.','액션','ALL','극한직업','MOVIE',0),(38,'송강호,이선균,조여정,최우식,박소담,장혜진,이정은,박명훈','봉준호','\"폐 끼치고 싶진 않았어요.\" 전원백수로 살 길 막막하지만 사이는 좋은 기택(송강호) 가족. 장남 기우(최우식)에게 명문대생 친구 민혁(박서준)이 연결시켜준 고액 과외 자리는 모처럼 싹튼 고정수입의 희망이다. 온 가족의 도움과 기대 속에 박 사장(이선균) 집으로 향하는 기우. 글로벌 IT 기업 CEO인 박 사장의 저택에 도착하자 젊고 아름다운 사모님 연교(조여정)가 기우를 맞이한다.','스릴러','ALL','기생충','MOVIE',1),(41,'타이터스 버지스','김범수','추억의 프로그램을 다채롭고 새롭게 제작한 시리즈. 보라돌이, 뚜비,나나,뽀와  함께 시나는 모험을 하며 새로운 것을 배워보세요! ','일상','KID','텔레토비','DRAMA',0),(44,'이병헌,조승우,백윤식 등','우민호','조폭/검찰/언론 거래는 끝났다!  “복수극으로 가자고, 화끈하게” 유력한 대통령 후보와 재벌 회장, 그들을 돕는 정치깡패 안상구(이병헌). 뒷거래의 판을 짠 이는 대한민국 여론을 움직이는 유명 논설주간 이강희(백윤식)다. 더 큰 성공을 원한 안상구는 이들의 비자금 파일로 거래를 준비하다 발각되고, 이 일로 폐인이 되어 버려진다.','스릴러','ALL','내부자들','MOVIE',0),(45,'김선아 ,오윤아,신은정,유선,이정진,오지호','정희욱','화려하게 성공한 세 명의 친구들 앞에 10년 전 그녀들의 거짓말로 살인자가 된 옛친구가 나타나면서 가면에 감춰져 있던 민낯이 드러나게 되고, 한 남자로 인해 인생의 소용돌이를 맞게 된 네 명의 친구들이 질투와 욕망의 전쟁을 시작하게 되는 이야기','스릴러','ALL','가면의여왕','DRAMA',0),(47,'황정민,이정재,박정민 외','홍원찬','태국에서 충격적인 납치사건이 발생하고 마지막 청부살인 미션을 끝낸 암살자 인남(황정민)은 그것이 자신과 관계된 것임을 알게 된다. 인남은 곧바로 태국으로 향하고, 조력자 유이(박정민)를 만나 사건을 쫓기 시작한다. 한편, 자신의 형제가 인남에게 암살당한 것을 알게 된 레이(이정재). 무자비한 복수를 계획한 레이는 인남을 추격하기 위해 태국으로 향하는데...','액션','ALL','다만 악에서 구하소서','MOVIE',0),(48,'조병규, 유준상,김세정,엄혜란,안석환,진선규','김선태','더 강해진 악귀 사냥꾼 \'카운터\'들이 더 악해진 지상의 악귀들을 물리치는 통쾌하고 땀내 나는 악귀 타파 히어로물','액션','ALL','경이로운 소문 시즌2','DRAMA',0),(50,'엄정화,황정민','이석훈','서울시장후보의 아내가 댄싱퀸?!  “혹시 가수 해 볼 생각 없어요?” 왕년의 신촌 마돈나 정화 앞에 댄스 