','마이클 뮬렌, 강제성','세계 최초로 끝내주게 멋진 경험을 하게 될 줄 알았다. 백각기 캠프 1기  참가로 뽑힌 여섯 명의 십 대 . 이들은 곧 공포에 휩 싸인다. 최고의 포식자 공룡이 풀려났다! ','액션','KID','쥬라기 월드백악기 어드벤처','DRAMA',0),(164,'야지마 아키코, 나라하시 미키, 후지와라 케이지 ','다카하시 와타루 ','짱구네 유치원에 새 친구가 전학 왔다. 그리고 이상한 꿈을 꾸기 시작하는 동네  사람들. 처음엔 바라는 모든 것이 이뤄지는 행복한 꿈인 줄 알았지만, 점차  기괴한 악몽으로 채워지는 꿈의 세계. 누가 제발 이 악몽 좀 멈춰 줘! ','스릴러','KID','짱구는 못말려 극장판 꿈꾸는 세계','MOVIE',0),(167,'허드슨 로베로, 콜린 크리칠리, 제나 아이아코노 ','정영홍 ','밝고 명량한 택배 비행기 호기. 세계 곳곳으로 잽싸게 날아가 선물도 전해주고  문제도 해결해주지요. 위험을 만나도 걱정 없어요. 멋진 변신 비행기 친구들이  있으니까요 ','액션','KID','출동 ! 슈퍼윙스 ','DRAMA',0),(170,'잭 블랙, 리타 오라, 제임스 홍','마크 오스본, 존 스티븐슨','엘리트 영국 기사와 파트너가 된 전설의 전사 포,  마법의 무기를 찾고 명예를 회복하기 위해 모험을 시작한다 ','액션','KID','쿵푸팬더 용의 기사','MOVIE',0),(173,'피터 컬런, 수말리 몬타노, 프랭크 웰커 ','알렉스 커츠만, 로베르토 오씨, 제프 클라인','인간 세 명과 협력하여 오토봇은 디셉티콘과 이들의 지도자 메가트론의 공격으로부터  다시 한 번 지구를 지킨다 ','액션','KID','트랜스포머 프라임 ','DRAMA',0);
